    cell_type VARCHAR(50),
    gene_name VARCHAR(50),
    expression_level DECIMAL(10, 2)
);

CREATE TABLE gene_expression_levels (
  cell_type VARCHAR(50),
  gene_name VARCHAR(50),
  expression_level FLOAT
);

CREATE TABLE cell_types (
  cell_type_id SERIAL PRIMARY KEY,
  cell_type_name VARCHAR(50)
);

CREATE TABLE GeneExpressionLevels(
  gene_id INT,
  cell_type VARCHAR(255),
  expression_level FLOAT
);

CREATE TABLE CellTypes(
  cell_type_id INT,
  cell_type_name VARCHAR(255),
  description TEXT
);

CREATE TABLE CellTypes (
 cell_type_id INT PRIMARY KEY,
 cell_type_name VARCHAR(50)
);

CREATE TABLE Genes (
 gene_id INT PRIMARY KEY,
 gene_name VARCHAR(50),
 gene_description TEXT
);

CREATE TABLE AnalysisResults (
 analysis_id INT PRIMARY KEY,
 expression_id INT,
 result_notes TEXT,
 FOREIGN KEY (expression_id) REFERENCES ExpressionLevels(expression_id)
);

CREATE TABLE GeneExpressionLevels (
    id UUID PRIMARY KEY,
    gene_symbol TEXT,
